.main {
  padding: 25px 0;
  background-image: url("../images/main-bg-mobile.jpg");
  background-position: center;
  background-repeat: no-repeat;

  @media (min-device-pixel-ratio: 2),
    (min-resolution: 2dpi),
    (min-resolution: 192dppx) {
    background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)),
      url("../images/main-bg-mobile@2x.jpg");
  }
  @media (min-width: 768px) {
    background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)),
      url("../images/main-bg-tablet.jpg");

    @media (min-device-pixel-ratio: 2),
      (min-resolution: 2dpi),
      (min-resolution: 192dppx) {
      background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)),
        url("../images/main-bg-tablet@2x.jpg");
    }
  }
  @media (min-width: 1200px) {
    background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)),
      url("../images/main-bg-desktop.jpg");

    @media (min-device-pixel-ratio: 2),
      (min-resolution: 2dpi),
      (min-resolution: 192dppx) {
      background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)),
        url("../images/main-bg-desktop@2x.jpg");
    }
  }
}
.main-list {
  display: flex;
  align-items: center;
  justify-content: center;
  flex-wrap: wrap;
  max-width: 280px;
  margin: 0 auto;
  gap: 30px 14px;
  @media (min-width: 768px) {
    gap: 45px 27px;
    max-width: 610px;
  }

  @media (min-width: 1200px) {
    gap: 50px 70px;
    max-width: 946px;
  }

  &__item {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    flex: 1 1 calc((100% - 14px) / 2);
    @media (min-width: 768px) {
      flex-basis: calc((100% - 54px) / 3);
    }
    @media (min-width: 1200px) {
      flex-basis: calc((100% - 210px) / 4);
    }
  }

  &__thumb {
    width: 128px;
    height: 161px;
    border-radius: 50px 0;
    position: relative;

    @media (min-width: 768px) {
      width: 180px;
      height: 277px;
    }

    &::after {
      content: "";
      position: absolute;
      top: -10px;
      right: -10px;
      width: 108px;
      height: 101px;
      border-radius: 50px 0;
      box-shadow: 0 0 15px rgba(220, 86, 197, 0.5);
      background-color: transparent;

      @media (min-width: 768px) {
        width: 160px;
        height: 160px;
      }
    }
  }
  &__img {
    border-radius: 50px 0;
    object-fit: cover;
    object-position: center;
    width: 100%;
    height: 100%; // ???
  }
  &__title {
    font-family: "Montserrat", sans-serif;
    font-weight: 700;
    font-size: 14px;
    text-align: center;
    color: #dc56c5;
    margin-top: 6px;
    @media (min-width: 768px) {
      font-size: 16px;
    }
  }
  &__date {
    font-family: "Montserrat", sans-serif;
    font-weight: 400;
    font-size: 14px;
    text-align: center;
    color: #fff;
    margin: 5px 0;
    @media (min-width: 768px) {
      font-size: 16px;
    }
  }
  &-locate {
    font-family: "Montserrat", sans-serif;
    font-weight: 600;
    font-size: 12px;
    color: #fff;
    @media (min-width: 768px) {
      font-size: 14px;
    }

    &__icon {
      fill: #fff;
      width: 11px;
      height: 11px;
    }
  }
}
.slider {
  display: flex;
  align-items: center;
  justify-content: flex-start;
  overflow-x: auto;
  max-width: 330px;
  margin: 80px auto;
  padding: 0 10px;
  scrollbar-width: thin;
  scrollbar-color: rgba(220, 86, 197, 0.5) transparent;

  &::-webkit-scrollbar {
    height: 6px;
  }
  &::-webkit-scrollbar-track {
    background: transparent;
  }
  &::-webkit-scrollbar-thumb {
    background-color: rgba(220, 86, 197, 0.5);
    border-radius: 3px;
  }
  &::-webkit-scrollbar-thumb:hover {
    background-color: rgba(220, 86, 197, 0.8);
  }

  -webkit-overflow-scrolling: touch;
  &__item {
    flex: 0 0 auto;
  }

  &__btn {
    font-family: "Montserrat", sans-serif;
    font-weight: 400;
    font-size: 16px;
    text-align: center;
    color: #fff;
    background-color: transparent;

    padding: 5px 12px;
    transition: color 250ms ease-in-out;

    min-width: 40px;
    flex-shrink: 0;

    &.active {
      border: 1px solid #dc56c5;
      border-radius: 10px 0;
      color: #dc56c5;
    }
  }
  &__text {
    font-family: "Montserrat", sans-serif;
    font-weight: 400;
    font-size: 16px;
    text-align: center;
    color: #fff;
    user-select: none;
    display: inline-block;
    padding: 5px 12px;
  }
}

